import React from "react";

import { Container, Row } from "reactstrap";

import Desk from "./containers/Desk/Desk";
import "./App.css";

const App = (props) => {
  return (
    <Container fluid="true" className="App">
      <Row>
        <Desk />
      </Row>
    </Container>
  );
};

export default App;
